import React from "react";

export const Tile = ({contacts}) => {
  let tiles = contacts.map((contact, index) => {
    if (index === 0) {
      return (
        <p className="tile-title">
          {contact.name}
        </p>
      )
    } else {
      return (
        <p className="tile">
          {contact.name}
        </p>
      )
    }
  })
  return (
    <div className="tile-container">
      {tiles}
    </div>
  );
};
